        "connection to facebook failed.": "\u041d\u0435\u0443\u0441\u043f\u0435\u0448\u043d\u0430 \u0432\u0440\u044a\u0437\u043a\u0430 \u0441 Facebook. ",
        "user does not accept shares.": "\u041f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u044f\u0442 \u043d\u0435 \u043f\u0440\u0438\u0435\u043c\u0430 \u043f\u043e\u043a\u0430\u043d\u0438 \u0437\u0430 \u0441\u043f\u043e\u0434\u0435\u043b\u044f\u043d\u0438\u044f.",
