        "become premium": "\u0421\u0442\u0430\u043d\u0438 \u043f\u0440\u0435\u043c\u0438\u0443\u043c",
        "the e-mail you've entered is not valid.": "\u0412\u044a\u0432\u0435\u0434\u0435\u043d\u0438\u044f\u0442 e-mail \u0435 \u043d\u0435\u0432\u0430\u043b\u0438\u0434\u0435\u043d.",
        "share link to your files so people can view and download them.": "\u0421\u043f\u043e\u0434\u0435\u043b\u0438 \u043b\u0438\u043d\u043a \u043a\u044a\u043c \u0444\u0430\u0439\u043b\u043e\u0432\u0435\u0442\u0435 \u0441\u0438, \u0437\u0430 \u0434\u0430 \u043c\u043e\u0433\u0430\u0442 \u0434\u0440\u0443\u0433\u0438 \u0445\u043e\u0440\u0430 \u0434\u0430 \u0433\u0438 \u043f\u0440\u0435\u0433\u043b\u0435\u0436\u0434\u0430\u0442 \u0438 \u0441\u0432\u0430\u043b\u044f\u0442.",
        '" already exists in the receiving folder.': '"\u0432\u0435\u0447\u0435 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430 \u0432 \u0442\u0430\u0437\u0438 \u043f\u0430\u043f\u043a\u0430.',
        "upload not found": "\u041a\u0430\u0447\u0435\u043d\u0438\u044f\u0442 \u0444\u0430\u0439\u043b \u043d\u0435 \u0435 \u043d\u0430\u043c\u0435\u0440\u0435\u043d",
        "please provide 'sharerequestid'.": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 'sharerequestid'.",
        "you currently have 10.0 gb space": "\u0412 \u043c\u043e\u043c\u0435\u043d\u0442\u0430 \u0440\u0430\u0437\u043f\u043e\u043b\u0430\u0433\u0430\u0448 \u0441 10 GB \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e",
        "file renamed.": "\u0424\u0430\u0439\u043b\u044a\u0442 \u0435 \u043f\u0440\u0435\u0438\u043c\u0435\u043d\u0443\u0432\u0430\u043d.",
        "both new passwords should match.": "\u0414\u0432\u0435\u0442\u0435 \u043f\u0430\u0440\u043e\u043b\u0438 \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u0441\u044a\u0432\u043f\u0430\u0434\u0430\u0442.",
        "invite friends and get up to 20gb free space": "\u041f\u043e\u043a\u0430\u043d\u0438 \u043f\u0440\u0438\u044f\u0442\u0435\u043b\u0438 \u0438 \u0432\u0437\u0435\u043c\u0438 \u0434\u043e 20 GB \u0431\u0435\u0437\u043f\u043b\u0430\u0442\u043d\u043e \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e.",
        "verify now": "\u041f\u043e\u0442\u0432\u044a\u0440\u0434\u0438",
        "ssl error occured. check sslerror for more information.": "\u0412\u044a\u0437\u043d\u0438\u043a\u043d\u0430 SSL \u0433\u0440\u0435\u0448\u043a\u0430. \u041f\u0440\u043e\u0432\u0435\u0440\u0438 SSL-error \u0437\u0430 \u043f\u043e\u0432\u0435\u0447\u0435 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f.",
        "directory does not exist.": "\u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u044f\u0442\u0430 \u043d\u0435 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430.",
        "log in to save": "\u0412\u043b\u0435\u0437, \u0437\u0430 \u0434\u0430 \u0437\u0430\u043f\u0430\u0437\u0438\u0448",
        "restart backup: ig": "\u0420\u0435\u0441\u0442\u0430\u0440\u0442\u0438\u0440\u0430\u0439 \u0431\u0435\u043a\u044a\u043f: ig",
        "very slow": "\u041c\u043d\u043e\u0433\u043e \u0431\u0430\u0432\u043d\u043e",
        "please provide 'url'.": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 'url'.",
        "link is copied to clipboard": "\u041b\u0438\u043d\u043a\u044a\u0442 \u0435 \u043a\u043e\u043f\u0438\u0440\u0430\u043d \u0432 \u041a\u043b\u0438\u043f\u0431\u043e\u0440\u0434\u0430",
        "max files:": "\u041c\u0430\u043a\u0441\u0438\u043c\u0443\u043c \u0444\u0430\u0439\u043b\u043e\u0432\u0435:",
        "please provide 'mail' to share folder with.": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 e-mail, \u043d\u0430 \u043a\u043e\u0439\u0442\u043e \u0438\u0441\u043a\u0430\u0448 \u0434\u0430 \u0441\u043f\u043e\u0434\u0435\u043b\u0438\u0448 \u043f\u0430\u043f\u043a\u0430\u0442\u0430.",
        "playlist created": "\u041f\u043b\u0435\u0439\u043b\u0438\u0441\u0442\u044a\u0442 \u0435 \u0441\u044a\u0437\u0434\u0430\u0434\u0435\u043d",
        "copy to my pcloud:": "\u041a\u043e\u043f\u0438\u0440\u0430\u0439 \u0432 \u043c\u043e\u044f pCloud",
