        "maximum file size exceeded.": "\u0424\u0430\u0439\u043b\u044a\u0442 \u043d\u0430\u0434\u0432\u0438\u0448\u0430\u0432\u0430 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u043d\u0438\u044f \u0440\u0430\u0437\u043c\u0435\u0440.",
        "wide desktop": "\u0420\u0430\u0437\u0448\u0438\u0440\u0435\u043d \u0434\u0435\u0441\u043a\u0442\u043e\u043f",
        "please provide 'progresshash'.": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 'progresshash'.",
        "invite your friends to join pcloud": "\u041f\u043e\u043a\u0430\u043d\u0438 \u043f\u0440\u0438\u044f\u0442\u0435\u043b\u0438\u0442\u0435 \u0441\u0438 \u0432 pCloud",
        "resend mail": "\u0418\u0437\u043f\u0440\u0430\u0442\u0438 \u043d\u043e\u0432 e-mail",
        "pcloud pro (100gb) for 1 month - $4.99": "pCloud \u041f\u0440\u0435\u043c\u0438\u0443\u043c (100GB) \u0437\u0430 1 \u043c\u0435\u0441\u0435\u0446 - $4.99",
        "invalid lock type. please provide type (supported values: 0, 1, 2).": '\u041d\u0435\u0432\u0430\u043b\u0438\u0434\u0435\u043d \u0442\u0438\u043f \u043d\u0430 \u043a\u043b\u044e\u0447\u0430\u043b\u043a\u0430\u0442\u0430. \u041c\u043e\u043b\u044f, \u0437\u0430\u0434\u0430\u0439 "type". (\u0432\u044a\u0437\u043c\u043e\u0436\u043d\u0438 \u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438 - 0 , 1 , 2).',
        "decline share": "\u041e\u0442\u043a\u0430\u0436\u0438 \u0441\u043f\u043e\u0434\u0435\u043b\u044f\u043d\u0435\u0442\u043e",
        "user is over quota.": "\u041f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u044f\u0442 \u0435 \u043f\u0440\u0435\u0432\u0438\u0448\u0438\u043b \u0441\u0432\u043e\u044f\u0442\u0430 \u043a\u0432\u043e\u0442\u0430.",
        "internal error. try again later.": "\u0412\u044a\u0442\u0440\u0435\u0448\u043d\u0430 \u0433\u0440\u0435\u0448\u043a\u0430. \u041c\u043e\u043b\u044f, \u043e\u043f\u0438\u0442\u0430\u0439\u0442\u0435 \u043e\u0442\u043d\u043e\u0432\u043e.",
        "extracting '%name%' may take some time. you can close this window. the file extraction will continue in background.": "\u0420\u0430\u0437\u0430\u0440\u0445\u0438\u0432\u0438\u0440\u0430\u043d\u0435\u0442\u043e \u043d\u0430 '%name%' \u043c\u043e\u0436\u0435 \u0434\u0430 \u043e\u0442\u043d\u0435\u043c\u0435 \u0434\u043e \u043d\u044f\u043a\u043e\u043b\u043a\u043e \u043c\u0438\u043d\u0443\u0442\u0438. \u0422\u043e \u0449\u0435 \u043f\u0440\u043e\u0434\u044a\u043b\u0436\u0438 \u0434\u043e\u0440\u0438 \u0430\u043a\u043e \u0437\u0430\u0442\u0432\u043e\u0440\u0438\u0442\u0435 \u0442\u043e\u0437\u0438 \u043f\u0440\u043e\u0437\u043e\u0440\u0435\u0446.",
        "pcloud pro (300gb) for 1 year - $149.99": "pCloud \u041f\u0440\u0435\u043c\u0438\u0443\u043c (300GB) \u0437\u0430 1 \u0433\u043e\u0434\u0438\u043d\u0430 - $149.99",
        "invalid file/folder name.": "\u041d\u0435\u0432\u0430\u043b\u0438\u0434\u043do \u0438\u043c\u0435 \u043d\u0430 \u0444\u0430\u0439\u043b/\u043f\u0430\u043f\u043a\u0430.",
        "itunes error.": "iTunes \u0433\u0440\u0435\u0448\u043a\u0430.",
        "checksum or file size do not match.": "\u0427\u0435\u043a\u0441\u0443\u043c\u0430\u0442\u0430 \u0438\u043b\u0438 \u0433\u043e\u043b\u0435\u043c\u0438\u043d\u0430\u0442\u0430 \u043d\u0430 \u0444\u0430\u0439\u043b\u0430 \u043d\u0435 \u0441\u044a\u0432\u043f\u0430\u0434\u0430\u0442.",
        "register to save": "\u0420\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u0430\u0439 \u0441\u0435 \u0438 \u0437\u0430\u043f\u0430\u0437\u0438",
