        "aborting ...": "\u041f\u0440\u0435\u043a\u0440\u0430\u0442\u044f\u0432\u0430\u043d\u0435 ...",
        "password too short. minimum length is 6 characters.": "\u041f\u0430\u0440\u043e\u043b\u0430\u0442\u0430 \u0435 \u0442\u0432\u044a\u0440\u0434\u0435 \u043a\u0440\u0430\u0442\u043a\u0430. \u041c\u0438\u043d\u0438\u043c\u0430\u043b\u043d\u0430\u0442\u0430 \u0434\u044a\u043b\u0436\u0438\u043d\u0430 \u0435 6 \u0441\u0438\u043c\u0432\u043e\u043b\u0430.",
        "please provide 'name'.": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 \u0438\u043c\u0435.",
        "share folder": "\u0421\u043f\u043e\u0434\u0435\u043b\u0438 \u043f\u0430\u043f\u043a\u0430",
        "given 'uploadlinkid' not found.": "\u041f\u043e\u0441\u043e\u0447\u0435\u043d\u0438\u044f\u0442 'uploadlinkid' \u043d\u0435 \u0435 \u043d\u0430\u043c\u0435\u0440\u0435\u043d.",
        "finish any": "\u0414\u043e\u0432\u044a\u0440\u0448\u0438 \u0432\u0441\u0438\u0447\u043a\u043e",
        "no fileid or path provided.": "\u041d\u0435 \u0441\u0430 \u0432\u044a\u0432\u0435\u0434\u0435\u043d\u0438 fileid \u0438 path.",
        "original size": "\u041e\u0440\u0438\u0433\u0438\u043d\u0430\u043b\u0435\u043d \u0440\u0430\u0437\u043c\u0435\u0440",
        "invalid or already deleted link.": "\u041d\u0435\u0432\u0430\u043b\u0438\u0434\u0435\u043d \u0438\u043b\u0438 \u0432\u0435\u0447\u0435 \u0438\u0437\u0442\u0440\u0438\u0442 \u043b\u0438\u043d\u043a.",
        "create playlist": "\u0421\u044a\u0437\u0434\u0430\u0439 \u043f\u043b\u0435\u0439\u043b\u0438\u0441\u0442",
        "download link is generated.": "\u041b\u0438\u043d\u043a\u044a\u0442 \u0437\u0430 \u0441\u0432\u0430\u043b\u044f\u043d\u0435 \u0435 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d. ",
        "valid and not expired facebook access token is required in field 'access_token'.": "\u0412 \u043f\u043e\u043b\u0435\u0442\u043e 'access_token' \u0432\u044a\u0432\u0435\u0434\u0438 \u0432\u0430\u043b\u0438\u0434\u0435\u043d \u0438 \u0430\u043a\u0442\u0438\u0432\u0435\u043d Facebook access token.",
        "verifying in progress ...": "\u041f\u043e\u0442\u0432\u044a\u0440\u0436\u0434\u0430\u0432\u0430\u043d\u0435 ...",
        "comment is required for creating a public upload link.": "\u0412\u044a\u0432\u0435\u0434\u0438 \u043a\u043e\u043c\u0435\u043d\u0442\u0430\u0440, \u0437\u0430 \u0434\u0430 \u0441\u044a\u0437\u0434\u0430\u0434\u0435\u0448 \u043b\u0438\u043d\u043a \u0437\u0430 \u043a\u0430\u0447\u0432\u0430\u043d\u0435.",
        "restore file": "\u0412\u044a\u0437\u0441\u0442\u0430\u043d\u043e\u0432\u0438 \u0444\u0430\u0439\u043b",
        "would you like to overwrite it?": "\u0416\u0435\u043b\u0430\u0435\u0448 \u043b\u0438 \u0434\u0430 \u043f\u0440\u0435\u0437\u0430\u043f\u0438\u0448\u0435\u0448 \u0444\u0430\u0439\u043b\u0430?",
        "type at least 3 letters to search.": "\u0412\u044a\u0432\u0435\u0434\u0438 \u043c\u0438\u043d\u0438\u043c\u0443\u043c 3 \u0431\u0443\u043a\u0432\u0438 \u0437\u0430 \u0442\u044a\u0440\u0441\u0435\u043d\u0435",
        "share is accepted.": "\u0421\u043f\u043e\u0434\u0435\u043b\u044f\u043d\u0435\u0442\u043e \u0435 \u043f\u0440\u0438\u0435\u0442\u043e.",
        "enter valid e-mail.": "\u0412\u044a\u0432\u0435\u0434\u0435\u0442\u0435 \u0432\u0430\u043b\u0438\u0434\u0435\u043d e-mail.",
        "new name is requied.": "\u0412\u044a\u0432\u0435\u0434\u0438 \u043d\u043e\u0432\u043e \u0438\u043c\u0435.",
        "share:": "\u0421\u043f\u043e\u0434\u0435\u043b\u0438:",
        "mobile / tablet": "\u0422\u0435\u043b\u0435\u0444\u043e\u043d/\u0422\u0430\u0431\u043b\u0435\u0442",
        "current password": "\u041d\u0430\u0441\u0442\u043e\u044f\u0449\u0430 \u043f\u0430\u0440\u043e\u043b\u0430",
        "this link has reached maximum downloads.": "\u041b\u0438\u043d\u043a\u044a\u0442 \u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0430 \u043b\u0438\u043c\u0438\u0442\u0430 \u0441\u0438 \u043d\u0430 \u0441\u0432\u0430\u043b\u044f\u043d\u0438\u044f.",
        "please provide 'length'.": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 'length'.",
        "\u0424\u0430\u0439\u043b renamed.": "\u0424\u0430\u0439\u043b\u044a\u0442 \u0435 \u043f\u0440\u0435\u0438\u043c\u0435\u043d\u0443\u0432\u0430\u043d.",
        "copy to folder": "\u041a\u043e\u043f\u0438\u0440\u0430\u0439 \u0432 \u043f\u0430\u043f\u043a\u0430",
        "no account? register now!": "\u041d\u044f\u043c\u0430\u0448 \u0430\u043a\u0430\u0443\u043d\u0442? \u0420\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u0430\u0439 \u0441\u0435 \u0441\u0435\u0433\u0430!",
        "download file": "\u0421\u0432\u0430\u043b\u0438 \u0444\u0430\u0439\u043b",
