        "you can only share your own files or folders. copy the file to a folder you own if you need to share it.": "\u041c\u043e\u0436\u0435\u0448 \u0434\u0430 \u0441\u043f\u043e\u0434\u0435\u043b\u044f\u0448 \u0441\u0430\u043c\u043e \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435 \u0438\u043b\u0438 \u043f\u0430\u043f\u043a\u0438. \u041a\u043e\u043f\u0438\u0440\u0430\u0439 \u0444\u0430\u0439\u043b\u0430 \u0432 \u0441\u0432\u043e\u044f \u043b\u0438\u0447\u043d\u0430 \u043f\u0430\u043f\u043a\u0430, \u0430\u043a\u043e \u0438\u0441\u043a\u0430\u0448 \u0434\u0430 \u0433\u043e \u0441\u043f\u043e\u0434\u0435\u043b\u0438\u0448.",
        "pcloud pro (300gb) for 1 month - $14.99": "pCloud \u041f\u0440\u0435\u043c\u0438\u0443\u043c (300GB) \u0437\u0430 1 \u043c\u0435\u0441\u0435\u0446 - $14.99",
        "save video to pcloud": "\u0417\u0430\u043f\u0430\u0437\u0438 \u0432\u0438\u0434\u0435\u043e \u0432 pCloud",
