        "accept all shares from this user": "\u041f\u0440\u0438\u0435\u043c\u0438 \u0432\u0441\u0438\u0447\u043a\u0438 \u0441\u043f\u043e\u0434\u0435\u043b\u044f\u043d\u0438\u044f \u043e\u0442 \u0442\u043e\u0437\u0438 \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b",
