        "items are moved.": "\u0424\u0430\u0439\u043b\u043e\u0432\u0435\u0442\u0435 \u0441\u0430 \u043f\u0440\u0435\u043c\u0435\u0441\u0442\u0435\u043d\u0438.",
        "language not supported.": "\u0415\u0437\u0438\u043a\u044a\u0442 \u043d\u0435 \u0441\u0435 \u043f\u043e\u0434\u0434\u044a\u0440\u0436\u0430.",
        "share permissions are saved.": "\u041f\u0440\u0430\u0432\u0430\u0442\u0430 \u0437\u0430 \u0441\u043f\u043e\u0434\u0435\u043b\u044f\u043d\u0435 \u0441\u0430 \u0437\u0430\u043f\u0430\u0437\u0435\u043d\u0438.",
        "offline access to all files that you marked as favorites.": "\u041e\u0444\u043b\u0430\u0439\u043d \u0434\u043e\u0441\u0442\u044a\u043f \u0434\u043e \u0432\u0441\u0438\u0447\u043a\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435, \u043c\u0430\u0440\u043a\u0438\u0440\u0430\u043d\u0438 \u043a\u0430\u0442\u043e \u043b\u044e\u0431\u0438\u043c\u0438. ",
