        "facebook user is already associated.": "\u0422\u043e\u0437\u0438 Facebook \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b \u0432\u0435\u0447\u0435 \u0435 \u0430\u0441\u043e\u0446\u0438\u0438\u0440\u0430\u043d.",
        "crop parts of the image to exactly fit the size.": "\u0418\u0437\u0440\u0435\u0436\u0438 \u0447\u0430\u0441\u0442 \u043e\u0442 \u0441\u043d\u0438\u043c\u043a\u0430\u0442\u0430, \u0437\u0430 \u0434\u0430 \u043e\u0442\u0433\u043e\u0432\u0430\u0440\u044f \u043d\u0430 \u0442\u043e\u0447\u043d\u0438\u044f \u0440\u0430\u0437\u043c\u0435\u0440.",
        "folder to share": "\u041f\u0430\u043f\u043a\u0430 \u0437\u0430 \u0441\u043f\u043e\u0434\u0435\u043b\u044f\u043d\u0435",
        "open after creation": "\u041e\u0442\u0432\u043e\u0440\u0438 \u0441\u043b\u0435\u0434 \u0441\u044a\u0437\u0434\u0430\u0432\u0430\u043d\u0435",
        "extract in new folder": "\u0420\u0430\u0437\u0430\u0440\u0445\u0438\u0432\u0438\u0440\u0430\u0439 \u0432 \u043d\u043e\u0432\u0430 \u043f\u0430\u043f\u043a\u0430",
        options: "\u041e\u043f\u0446\u0438\u0438",
