        "link(s) deleted.": "\u041b\u0438\u043d\u043a\u043e\u0432\u0435\u0442\u0435 \u0441\u0430 \u0438\u0437\u0442\u0440\u0438\u0442\u0438.",
        "your e-mail:": "\u0422\u0432\u043e\u044f\u0442 e-mail",
