        "extract finished.": "\u0420\u0430\u0437\u0430\u0440\u0445\u0438\u0432\u0438\u0440\u0430\u043d\u0435\u0442\u043e \u0435 \u0437\u0430\u0432\u044a\u0440\u0448\u0435\u043d\u043e.",
        "please provide 'offset'.": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 \u043e\u0442\u043c\u0435\u0441\u0442\u0432\u0430\u043d\u0435 ('offset').",
        "enter your e-mail to reset your password": "\u0412\u044a\u0432\u0435\u0434\u0435\u0442\u0435 \u0441\u0432\u043e\u044f e-mail, \u0437\u0430 \u0434\u0430 \u043f\u043e\u0434\u043d\u043e\u0432\u0438\u0442\u0435 \u043f\u0430\u0440\u043e\u043b\u0430\u0442\u0430",
