        "please provide 'permissions' for the share.": "\u041c\u043e\u043b\u044f, \u0437\u0430\u0434\u0430\u0439\u0442\u0435 \u043f\u0440\u0430\u0432\u0430 \u0437\u0430 \u0434\u043e\u0441\u0442\u044a\u043f \u0434\u043e \u0441\u043f\u043e\u0434\u0435\u043b\u0435\u043d\u0438\u0442\u0435 \u0444\u0430\u0439\u043b\u043e\u0432\u0435 ('permissions').",
        uploading: "\u041a\u0430\u0447\u0432\u0430\u043d\u0435",
        "thank you! your subscription was accepted and now is being processed. you will receive a confirmation email when payment is received.": "\u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f! \u0410\u0431\u043e\u043d\u0430\u043c\u0435\u043d\u0442\u044a\u0442 \u0435 \u043f\u0440\u0438\u0435\u0442 \u0438 \u0432 \u043c\u043e\u043c\u0435\u043d\u0442\u0430 \u0441\u0435 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u0432\u0430. \u041f\u043e-\u043a\u044a\u0441\u043d\u043e \u0449\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u0435 e-mail \u0437\u0430 \u043f\u043e\u0442\u0432\u044a\u0440\u0434\u0435\u043d\u043e \u043f\u043b\u0430\u0449\u0430\u043d\u0435.",
        "connection to picasa web albums failed.": " \u0412\u0440\u044a\u0437\u043a\u0430\u0442\u0430 \u043a\u044a\u043c Picasa Web Albums \u0435 \u043d\u0435\u0443\u0441\u043f\u0435\u0448\u043d\u0430.",
        "pcloud pro (100gb) for 1 yeat - $49.99": "pCloud \u041f\u0440\u0435\u043c\u0438\u0443\u043c (100GB) \u0437\u0430 1 \u0433\u043e\u0434\u0438\u043d\u0430 ",
        "finish one more step and get +1gb for free.": "\u0414\u043e\u0432\u044a\u0440\u0448\u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0430\u0442\u0430 \u0441\u0442\u044a\u043f\u043a\u0430 \u0438 \u0432\u0437\u0435\u043c\u0438 +1GB \u0431\u0435\u0437\u043f\u043b\u0430\u0442\u043d\u043e!",
        "bitcoin payment": "\u041f\u043b\u0430\u0449\u0430\u043d\u0435 \u0441 Bitcoin",
