        "our technical support team is at your service 24/7. if you have any questions regarding the usage of pcloud, please visit our f.a.q section. in case you need further assistance, feel free to contact us and we will carefully consider your issue.": "\u041d\u0430\u0448\u0438\u044f\u0442 \u0435\u043a\u0438\u043f \u043f\u043e \u043f\u043e\u0434\u0434\u0440\u044a\u0436\u043a\u0430 \u0435 \u043d\u0430 \u0440\u0430\u0437\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 24/7. \u0410\u043a\u043e \u0438\u043c\u0430\u0442\u0435 \u043d\u044f\u043a\u0430\u043a\u0432\u0438 \u0432\u044a\u043f\u0440\u043e\u0441\u0438 \u043e\u0442\u043d\u043e\u0441\u043d\u043e \u043d\u0430\u0447\u0438\u043d\u0430 \u043d\u0430 \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430\u043d\u0435 \u043d\u0430 pCloud, \u043f\u0440\u0435\u0433\u043b\u0435\u0434\u0430\u0439\u0442\u0435 \u043d\u0430\u0448\u0438\u0442\u0435 \u0447\u0435\u0441\u0442\u043e \u0437\u0430\u0434\u0430\u0432\u0430\u043d\u0438 \u0432\u044a\u043f\u0440\u043e\u0441\u0438. \u0412 \u0441\u043b\u0443\u0447\u0430\u0439, \u0447\u0435 \u0438\u043c\u0430\u0442\u0435 \u043d\u0443\u0436\u0434\u0430 \u043e\u0442 \u0434\u043e\u043f\u044a\u043b\u043d\u0438\u0442\u0435\u043b\u043d\u0430 \u043f\u043e\u043c\u043e\u0449, \u043c\u043e\u043b\u044f \u0441\u0432\u044a\u0440\u0436\u0435\u0442\u0435 \u0441\u0435 \u0441 \u043d\u0430\u0441 \u0438 \u043d\u0438\u0435 \u0449\u0435 \u043d\u0430\u043f\u0440\u0430\u0432\u0438\u043c \u0432\u0441\u0438\u0447\u043a\u043e \u0432\u044a\u0437\u043c\u043e\u0436\u043d\u043e \u0434\u0430 \u0440\u0430\u0437\u0440\u0435\u0448\u0438\u043c \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430 \u0432\u0438. ",
