        "source and target are the same file.": "\u041c\u044f\u0441\u0442\u043e\u0442\u043e \u043e\u0442 \u0438 \u043a\u044a\u043c \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0432\u0430\u0442 \u0435\u0434\u0438\u043d \u0438 \u0441\u044a\u0449\u0438 \u0444\u0430\u0439\u043b.",
