        "Instant access to all your files from everywhere.": "\u0411\u044a\u0440\u0437 \u0434\u043e\u0441\u0442\u044a\u043f \u0434\u043e \u0432\u0441\u0438\u0447\u043a\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435 \u043d\u0430\u0432\u0441\u044f\u043a\u044a\u0434\u0435.",
        "pCloud is the place to store all your photos, videos and large files. Everything in one safe place and available on any device, anywhere. Sign up and get up to 20GB FREE space!": "pCloud \u0435 \u043c\u044f\u0441\u0442\u043e\u0442\u043e, \u043a\u044a\u0434\u0435\u0442\u043e \u043c\u043e\u0436\u0435\u0448 \u0434\u0430 \u0441\u044a\u0445\u0440\u0430\u043d\u0438\u0448 \u0441\u0432\u043e\u0438\u0442\u0435 \u0441\u043d\u0438\u043c\u043a\u0438, \u0432\u0438\u0434\u0435\u0430 \u0438 \u0433\u043e\u043b\u0435\u043c\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435. \u0412\u0441\u0438\u0447\u043a\u043e, \u0441\u044a\u0431\u0440\u0430\u043d\u043e \u043d\u0430 \u0435\u0434\u043d\u043e \u043c\u044f\u0441\u0442\u043e, \u0434\u043e\u0441\u0442\u044a\u043f\u043d\u043e \u043e\u0442 \u0432\u0441\u0438\u0447\u043a\u0438 \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430, \u043f\u043e \u0432\u0441\u044f\u043a\u043e \u0432\u0440\u0435\u043c\u0435. \u041f\u0440\u0438\u0441\u044a\u0435\u0434\u0438\u043d\u0438 \u0441\u0435 \u0438 \u0432\u0437\u0435\u043c\u0438 \u0434\u043e 20 GB \u0411\u0415\u0417\u041f\u041b\u0410\u0422\u041d\u041e \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e!",
        'Please provide valid "restoreto".': '\u041c\u043e\u043b\u044f, \u0437\u0430\u0434\u0430\u0439 \u0432\u0430\u043b\u0438\u0434\u043d\u043e \u043c\u044f\u0441\u0442\u043e \u0437\u0430 \u0432\u044a\u0437\u0441\u0442\u0430\u043d\u043e\u0432\u044f\u0432\u0430\u043d\u0435 ("restoreto").',
