        "The security code is a group of 3 digits located on the back of the card, to the right of the signature strip.": "\u041a\u043e\u0434\u044a\u0442 \u0437\u0430 \u0441\u0438\u0433\u0443\u0440\u043d\u043e\u0441\u0442 \u0435 \u043a\u043e\u043c\u0431\u0438\u043d\u0430\u0446\u0438\u0435 \u043e\u0442 3 \u0446\u0438\u0444\u0440\u0438, \u043a\u043e\u0438\u0442\u043e \u0441\u0435 \u043d\u0430\u043c\u0438\u0440\u0430\u0442 \u043d\u0430 \u0433\u044a\u0440\u0431\u0430 \u043d\u0430 \u043a\u0430\u0440\u0442\u0430\u0442\u0430, \u0432\u0434\u044f\u0441\u043d\u043e \u043e\u0442 \u043f\u043e\u043b\u0435\u0442\u043e \u0437\u0430 \u043f\u043e\u0434\u043f\u0438\u0441.",
        "Your card code is a 3 or 4 digit number that is found in these locations:": "\u041a\u043e\u0434\u044a\u0442 \u043d\u0430 \u043a\u0430\u0440\u0442\u0430\u0442\u0430 \u0432\u0438 \u0435 3 \u0438\u043b\u0438 4 \u0446\u0438\u0444\u0440\u0435\u043d\u043e \u0447\u0438\u0441\u043b\u043e, \u043a\u043e\u0435\u0442\u043e \u0441\u0435 \u043d\u0430\u043c\u0438\u0440\u0430 \u043d\u0430 \u0435\u0434\u043d\u043e \u043e\u0442 \u043c\u0435\u0441\u0442\u0430\u0442\u0430:",
