        "You need to accept Terms of Service and all other agreements to register.": "\u0422\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u043f\u0440\u0438\u0435\u043c\u0435\u0442\u0435 \u0423\u0441\u043b\u043e\u0432\u0438\u044f\u0442\u0430 \u0437\u0430 \u043f\u043e\u043b\u0437\u0432\u0430\u043d\u0435 \u0438 \u0432\u0441\u0438\u0447\u043a\u0438 \u0434\u0440\u0443\u0433\u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0438, \u0437\u0430 \u0434\u0430 \u0441\u0435 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u0430\u0442\u0435.",
        "* Your subscription will automatically renew unless cancelled at least 24-hours before the end of the current period.": "* \u0422\u0432\u043e\u044f\u0442 \u0430\u0431\u043e\u043d\u0430\u043c\u0435\u043d\u0442\u0435\u043d \u043f\u043b\u0430\u043d \u0449\u0435 \u0441\u0435 \u043f\u043e\u0434\u043d\u043e\u0432\u0438 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e, \u0430\u043a\u043e \u043d\u0435 \u0433\u043e \u0441\u043f\u0440\u0435\u0448 24 \u0447\u0430\u0441\u0430 \u043f\u0440\u0435\u0434\u0438 \u0438\u0437\u0442\u0438\u0447\u0430\u043d\u0435\u0442\u043e \u043c\u0443.",
        'Please provide "fileids".': '\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0438 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u043e\u0440\u0438 \u043d\u0430 \u0444\u0430\u0439\u043b\u043e\u0432\u0435 ("fileids").',
