        "Import your photos into pCloud and get additional 500 MB free space.": "\u041f\u0440\u0435\u0445\u0432\u044a\u0440\u043b\u0438 \u0441\u043d\u0438\u043c\u043a\u0438\u0442\u0435 \u0441\u0438 \u0432 pCloud \u0438 \u0432\u0437\u0435\u043c\u0438 500 MB \u0434\u043e\u043f\u044a\u043b\u043d\u0438\u0442\u0435\u043b\u043d\u043e \u0431\u0435\u0437\u043f\u043b\u0430\u0442\u043d\u043e \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e.",
        TB: "TB",
