        "Billing address can't be empty": "\u041c\u043e\u043b\u044f, \u0432\u044a\u0432\u0435\u0434\u0435\u0442\u0435 \u0430\u0434\u0440\u0435\u0441 \u0437\u0430 \u0444\u0430\u043a\u0442\u0443\u0440\u0438\u0440\u0430\u043d\u0435 ",
        "Extracting '%name%' may take some time. You can close this window. The file extraction will continue in background.": "\u0420\u0430\u0437\u0430\u0440\u0445\u0438\u0432\u0438\u0440\u0430\u043d\u0435\u0442\u043e \u043d\u0430 '%name%' \u043c\u043e\u0436\u0435 \u0434\u0430 \u043e\u0442\u043d\u0435\u043c\u0435 \u0434\u043e \u043d\u044f\u043a\u043e\u043b\u043a\u043e \u043c\u0438\u043d\u0443\u0442\u0438. \u0422\u043e \u0449\u0435 \u043f\u0440\u043e\u0434\u044a\u043b\u0436\u0438 \u0434\u043e\u0440\u0438 \u0430\u043a\u043e \u0437\u0430\u0442\u0432\u043e\u0440\u0438\u0442\u0435 \u0442\u043e\u0437\u0438 \u043f\u0440\u043e\u0437\u043e\u0440\u0435\u0446.",
        "File or folder already exists.": "\u0424\u0430\u0439\u043b\u044a\u0442 \u0438\u043b\u0438 \u043f\u0430\u043f\u043a\u0430\u0442\u0430 \u0432\u0435\u0447\u0435 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430\u0442.",
        High: "\u0412\u0438\u0441\u043e\u043a",
        "Invalid 'mail' provided.": "\u041f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0435\u043d \u0435 \u043d\u0435\u0432\u0430\u043b\u0438\u0434\u0435\u043d e-mail.",
        "Link copied.": "\u041b\u0438\u043d\u043a\u044a\u0442 \u0435 \u043a\u043e\u043f\u0438\u0440\u0430\u043d.",
        "No information available": "\u041d\u044f\u043c\u0430 \u043d\u0430\u043b\u0438\u0447\u043d\u0430 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f",
        "Pick destination for archive.": "\u0418\u0437\u0431\u0435\u0440\u0438 \u043c\u044f\u0441\u0442\u043e \u0437\u0430 \u0430\u0440\u0445\u0438\u0432\u0430.",
        "Pick folder.": "\u0418\u0437\u0431\u0435\u0440\u0438 \u043f\u0430\u043f\u043a\u0430",
        "Playlist Deleted.": "\u041f\u043b\u0435\u0439\u043b\u0438\u0441\u0442\u044a\u0442 \u0435 \u0438\u0437\u0442\u0440\u0438\u0442.",
        "Save to pCloud": "\u0417\u0430\u043f\u0430\u0437\u0438 \u0432 pCloud",
