        "User already in team": "\u041f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u044f\u0442 \u0432\u0435\u0447\u0435 \u0435 \u0432 \u0435\u043a\u0438\u043f\u0430",
        "You can copy the file to one of your folders. That's making you the owner of the file and therefore you can create a download link.": "\u041c\u043e\u0436\u0435\u0442\u0435 \u0434\u0430 \u043a\u043e\u043f\u0438\u0440\u0430\u0442\u0435 \u0444\u0430\u0439\u043b\u0430 \u0432 \u0435\u0434\u043d\u0430 \u043e\u0442 \u0432\u0430\u0448\u0438\u0442\u0435 \u043f\u0430\u043f\u043a\u0438. \u0422\u043e\u0432\u0430 \u0432\u0438 \u043f\u0440\u0430\u0432\u0438 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u0438\u043a \u043d\u0430 \u0444\u0430\u0439\u043b\u0430, \u043a\u043e\u0435\u0442\u043e \u0432\u0438 \u0434\u0430\u0432\u0430 \u043f\u0440\u0430\u0432\u043e \u0434\u0430 \u0441\u044a\u0437\u0434\u0430\u0434\u0435\u0442\u0435 \u043b\u0438\u043d\u043a \u0437\u0430 \u0441\u0432\u0430\u043b\u044f\u043d\u0435 \u043a\u044a\u043c \u043d\u0435\u0433\u043e.",
