        "Zip is Ready.": "\u0410\u0440\u0445\u0438\u0432\u044a\u0442 \u0435 \u0433\u043e\u0442\u043e\u0432.",
        "Zip not found": "\u0410\u0440\u0445\u0438\u0432\u044a\u0442 \u043d\u0435 \u0435 \u043d\u0430\u043c\u0435\u0440\u0435\u043d",
        Delete_business_user_warning: '\u0412\u043d\u0438\u043c\u0430\u043d\u0438\u0435! \u041f\u0440\u0438 \u0438\u0437\u0442\u0440\u0438\u0432\u0430\u043d\u0435 \u043d\u0430 \u0442\u043e\u0437\u0438 \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b, \u0432\u0438\u0435 \u0449\u0435 \u0438\u0437\u0442\u0440\u0438\u0435\u0442\u0435 \u0432\u0441\u0438\u0447\u043a\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435, \u043f\u0430\u043f\u043a\u0438, \u0441\u043f\u043e\u0434\u0435\u043b\u044f\u043d\u0438\u044f \u0438 \u043b\u0438\u043d\u043a\u043e\u0432\u0435 \u043d\u0430 \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u044f. \u0422\u043e\u0432\u0430 \u0435 \u043f\u0435\u0440\u043c\u0430\u043d\u0435\u043d\u0442\u043d\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u0438 \u043d\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0431\u044a\u0434\u0435 \u043e\u0442\u043c\u0435\u043d\u0435\u043d\u043e! \u0410\u043a\u043e \u0438\u0441\u043a\u0430\u0442\u0435 \u0434\u0430 \u0438\u0437\u0442\u0440\u0438\u0435\u0442\u0435 \u0442\u043e\u0437\u0438 \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b, \u043d\u0430\u0442\u0438\u0441\u043d\u0435\u0442\u0435 \u0431\u0443\u0442\u043e\u043d\u0430 <br> <strong>"\u0418\u0437\u0442\u0440\u0438\u0439"</strong>.',
        "Show Deleted Users": "\u041f\u043e\u043a\u0430\u0436\u0438 \u0438\u0437\u0442\u0440\u0438\u0442\u0438\u0442\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0438",
