        DOWNLOAD_LINK_LIMIT_REACHED_EXPLANATON_LOGGEDIN: "\u0417\u0430\u043f\u0430\u0437\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435\u0442\u0435 \u0432 \u0442\u0432\u043e\u044f pCloud \u0430\u043a\u0430\u0443\u043d\u0442, \u0437\u0430 \u0434\u0430 \u0438\u043c\u0430\u0448 \u043c\u0438\u0433\u043d\u043e\u0432\u0435\u043d \u0434\u043e\u0441\u0442\u044a\u043f \u0434\u043e \u0442\u044f\u0445.",
        "Delete this link(s)": "\u0418\u0437\u0442\u0440\u0438\u0439 \u0442\u043e\u0437\u0438 \u043b\u0438\u043d\u043a",
