        "user already has access to this folder or subfolder of this folder.": "\u0423 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0443\u0436\u0435 \u0435\u0441\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f \u043a \u044d\u0442\u043e\u0439 \u043f\u0430\u043f\u043a\u0435 \u0438\u043b\u0438 \u043f\u043e\u0434\u043f\u0430\u043f\u043a\u0435 \u044d\u0442\u043e\u0439 \u043f\u0430\u043f\u043a\u0438. ",
