        "become premium user and get up to 1 tb space.": "\u0421\u0442\u0430\u043d\u044c\u0442\u0435 \u043f\u0440\u0435\u043c\u0438\u0443\u043c \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u043c \u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u0435 \u0434\u043e 1 TB \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0430.",
        "get started with pcloud basics": "\u041d\u0430\u0447\u0430\u0442\u044c \u0440\u0430\u0431\u043e\u0442\u0443 \u0441 \u0431\u0430\u0437\u043e\u0432\u043e\u0439 \u0432\u0435\u0440\u0441\u0438\u0435\u0439 pCloud",
        "not modified": "\u041d\u0435 \u0438\u0437\u043c\u0435\u043d\u0435\u043d",
