        "<font><font><font><font>get more space</font></font></font></font>": "\u0411\u043e\u043b\u044c\u0448\u0435 \u043c\u0435\u0441\u0442\u0430",
        "verify your e-mail": "\u043f\u0440\u043e\u0432\u0435\u0440\u0438\u0442\u044c \u0412\u0430\u0448 \u0435-\u043c\u0430\u0439\u043b",
