        "expired 'token'.": "\u0418\u0441\u0442\u0435\u043a\u0448\u0438\u0439 '\u0441\u0438\u043c\u0432\u043e\u043b'",
        "share link to this folder so your friends can upload files to your account.": "\u041f\u043e\u0434\u0435\u043b\u0438\u0442\u0435\u0441\u044c \u0441\u0441\u044b\u043b\u043a\u043e\u0439 \u043a \u044d\u0442\u043e\u0439 \u043f\u0430\u043f\u043a\u0435. \u0412\u0430\u0448\u0438 \u0434\u0440\u0443\u0437\u044c\u044f \u0441\u043c\u043e\u0433\u0443\u0442 \u0437\u0430\u0433\u0440\u0443\u0436\u0438\u0442\u044c \u0444\u0430\u0439\u043b\u044b \u043f\u0440\u044f\u043c\u043e \u0432 \u0412\u0430\u0448 \u0430\u043a\u043a\u0430\u0443\u043d\u0442.",
        "you can not create a download link from a shared folder because you are not the owner of the file.": "\u0412\u044b \u043d\u0435 \u043c\u043e\u0436\u0435\u0442\u0435 \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u0441\u0441\u044b\u043b\u043a\u0443 \u0434\u043b\u044f \u0441\u043a\u0430\u0447\u0438\u0432\u0430\u043d\u0438\u044f \u043a \u043f\u0430\u043f\u043a\u0435 \u0432 \u043e\u0431\u0449\u0435\u043c \u0434\u043e\u0441\u0442\u0443\u043f\u0435. \u0412\u044b \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0435\u0441\u044c \u0432\u043b\u0430\u0434\u0435\u043b\u044c\u0446\u0435\u043c \u044d\u0442\u043e\u0433\u043e \u0444\u0430\u0439\u043b\u0430.",
        "repeat playlist": "\u041f\u043e\u0432\u0442\u043e\u0440\u0438\u0442\u044c \u043f\u043b\u0435\u0439\u043b\u0438\u0441\u0442",
        "finish all steps and get total of 3gb space.": "\u0417\u0430\u0432\u0435\u0440\u0448\u0438\u0442\u0435 \u0432\u0441\u0435 \u0448\u0430\u0433\u0438 \u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u0435 3 GB \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0430.",
        "security code:": "\u041a\u043e\u0434 \u0434\u043e\u0441\u0442\u0443\u043f\u0430:",
