        "your files on all your devices": "\u0412\u0430\u0448\u0438 \u0444\u0430\u0439\u043b\u044b \u043d\u0430 \u0432\u0441\u0435\u0445 \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430\u0445",
