        "bonus is not accessiblie via the api.": "\u0411\u043e\u043d\u0443\u0441 \u043d\u0435 \u0434\u043e\u0441\u0442\u0443\u043f\u0435\u043d \u0447\u0435\u0440\u0435\u0437 API.",
