        "bonus was already given to the user.": "\u0411\u043e\u043d\u0443\u0441 \u0443\u0436\u0435 \u0431\u044b\u043b \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d \u0434\u0430\u043d\u043d\u043e\u043c\u0443 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044e.",
        "comment:": "\u041a\u043e\u043c\u043c\u0435\u043d\u0442\u0430\u0440\u0438\u0439:",
        "no full path or name/folderid provided.": "\u0423\u043a\u0430\u0437\u0430\u043d \u043d\u0435\u043f\u043e\u043b\u043d\u044b\u0439 \u043f\u0443\u0442\u044c, \u0438\u043c\u044f \u0438\u043b\u0438 ID \u043f\u0430\u043f\u043a\u0438. ",
        "the security code is a group of 3 digits located on the back of the card, to the right of the signature strip.": "\u041a\u043e\u0434 \u0434\u043e\u0441\u0442\u0443\u043f\u0430 - \u044d\u0442\u043e 3 \u0446\u0438\u0444\u0440\u044b, \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u0435\u0441\u044f \u043d\u0430 \u0437\u0430\u0434\u043d\u0435\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u0435 \u043a\u0430\u0440\u0442\u044b, \u0441\u043f\u0440\u0430\u0432\u0430 \u043e\u0442 \u043f\u043e\u0434\u043f\u0438\u0441\u0438.",
        "your card code is a 3 or 4 digit number that is found in these locations:": "\u041a\u043e\u0434 \u0412\u0430\u0448\u0435\u0439 \u043a\u0430\u0440\u0442\u044b 3 \u0438\u043b\u0438 4-\u0437\u043d\u0430\u0447\u043d\u044b\u0439 \u043d\u043e\u043c\u0435\u0440, \u043a\u043e\u0442\u043e\u0442\u044b\u0439 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u044d\u0442\u0438\u0445 \u043c\u0435\u0441\u0442\u0430\u0445:",
        "copying ...": "\u041a\u043e\u043f\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435...",
        "please, send the bitcoin ammount to the address above.": "\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043e\u0442\u043f\u0440\u0430\u0432\u044c\u0442\u0435 \u0441\u0443\u043c\u043c\u0443 \u0447\u0435\u0440\u0435\u0437 Bitcoin, \u043f\u043e \u0432\u044b\u0448\u0435\u0443\u043a\u0430\u0437\u0430\u043d\u043d\u043e\u043c\u0443 \u0430\u0434\u0440\u0435\u0441\u0443.",
        "please provide language.": "\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u0432\u044b\u0431\u0435\u0440\u0438\u0442\u0435 \u044f\u0437\u044b\u043a",
        "register new account": "\u0417\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043d\u043e\u0432\u044b\u0439 \u0430\u043a\u043a\u0430\u0443\u043d\u0442",
        "search artists": "\u041f\u043e\u0438\u0441\u043a \u0430\u0440\u0442\u0438\u0441\u0442\u043e\u0432",
