        slow: "\u041c\u0435\u0434\u043b\u0435\u043d\u043d\u043e",
        "connection to itunes failed.": "\u041d\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u044c\u0441\u044f \u043a iTunes",
        running: "\u0417\u0430\u043f\u0443\u0441\u043a",
        "check your e-mail for further instructions.": "\u041f\u0440\u043e\u0432\u0435\u0440\u044c\u0442\u0435 \u0432\u0430\u0448 e-mail \u0434\u043b\u044f \u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u044f \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0438\u0445 \u0438\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0439.",
        "tip:": "\u0421\u043e\u0432\u0435\u0442:",
        "log in failed.": "\u0412\u043e\u0439\u0442\u0438 \u043d\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c.",
