        "please provide 'fileids'.": "\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u0432\u0432\u0435\u0434\u0438\u0442\u0435 'fileids'.",
        "please provide 'permissions' for the share.": "\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u0432\u0432\u0435\u0434\u0438\u0442\u0435 'permissions' \u0434\u043b\u044f \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f \u043e\u0431\u0449\u0435\u0433\u043e \u0434\u043e\u0441\u0442\u0443\u043f\u0430.",
        uploading: "\u0417\u0430\u0433\u0440\u0443\u0437\u043a\u0430",
        "thank you! your subscription was accepted and now is being processed. you will receive a confirmation email when payment is received.": "\u0421\u043f\u0430\u0441\u0438\u0431\u043e! \u0412\u0430\u0448\u0430 \u043f\u043e\u0434\u043f\u0438\u0441\u043a\u0430 \u043f\u0440\u0438\u043d\u044f\u0442\u0430, \u0441\u0435\u0439\u0447\u0430\u0441 \u043e\u043d\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u0435. \u041a\u043e\u0433\u0434\u0430 \u043c\u044b \u043f\u043e\u043b\u0443\u0447\u0438\u043c \u043f\u043b\u0430\u0442\u0435\u0436, \u0412\u044b \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u0435 e-mail \u0441 \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u0435\u043c.",
        "connection to picasa web albums failed.": "\u041d\u0435 \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u044c\u0441\u044f \u043a Picasa.",
        "pcloud pro (100gb) for 1 yeat - $49.99": "pCloud Pro (100GB) \u0437\u0430 1 \u0433\u043e\u0434 - $49.99",
        "finish one more step and get +1gb for free.": "\u041f\u0440\u043e\u0439\u0434\u0438\u0442\u0435 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u044d\u0442\u0430\u043f \u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u0435 +1GB \u0431\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u043e.",
        "bitcoin payment": "\u041f\u043b\u0430\u0442\u0435\u0436 Bitcoin",
