        "log in required.": "\u0422\u0440\u0435\u0431\u0443\u0435\u0442\u0441\u044f \u0432\u043e\u0439\u0442\u0438 \u0432 \u0430\u043a\u043a\u0430\u0443\u043d\u0442.",
        "<font><font><font><font>space:</font></font></font></font>": "\u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e:",
        "steps and get +1gb for free.": "\u0448\u0430\u0433\u0438 \u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u0435 +1 GB \u0431\u0435\u0441\u043f\u043b\u0430\u0442\u043d\u043e.",
