        sharemodal_explain_business: "\u041f\u0440\u0438\u0433\u043b\u0430\u0441\u0438\u0442\u044c \u0411\u0438\u0437\u043d\u0435\u0441 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u0439 \u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u044b \u0432 \u043f\u0430\u043f\u043a\u0443 \u0438 \u0432\u044b\u0431\u0440\u0430\u0442\u044c \u0442\u0438\u043f \u0434\u043e\u0441\u0442\u0443\u043f\u0430.",
