        sharemodal_explain_shareout: "\u041f\u0440\u0438\u0433\u043b\u0430\u0441\u0438\u0442\u0435 \u043b\u044e\u0434\u0435\u0439 \u0432\u043d\u0435 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438, \u0447\u0442\u043e\u0431\u044b \u043f\u0440\u043e\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u0442\u044c \u0438 \u0438\u0437\u043c\u0435\u043d\u044f\u0442\u044c \u0444\u0430\u0439\u043b\u044b.",
