        "You have exceeded your Users Quota, please contact the account admin or someone with billing setting to upgrade quota.": "Voc\u00ea excedeu sua Cota de Usu\u00e1rios, por favor entre em contato com o administrador da conta ou com algu\u00e9m com acesso \u00e0 cobran\u00e7a para fazer o upgrade da cota.",
        account_manage_explain: "Um usu\u00e1rio, tendo os direitos de Gerenciamento de Contas, pode realizar as seguintes a\u00e7\u00f5es:\n<ul>\n<li> modificar as informa\u00e7\u00f5es da Conta e configura\u00e7\u00f5es de compartilhamento;</li>\n<li> modificar as informa\u00e7\u00f5es de Faturamento;</li>\n<li> modificar seu plano de assinatura e cota;</li>\n<li> convidar pessoas para a Conta Empresarial.</li>\n</ul>",
        billing_manage_explain: "Um usu\u00e1rio, tendo os direitos de Gerenciamento de Faturamento, pode realizar as seguintes a\u00e7\u00f5es:\n<ul> \n <li> modificar os dados de faturamento</li>\n</ul>\nEste usu\u00e1rio n\u00e3o pode modificar o plano de assinatura e a cota da Conta Empresarial.",
        log_view_explain: "Um usu\u00e1rio, tendo os direitos de Visualizar Registro, pode visualizar o registro de atividade de outros usu\u00e1rios.",
        team_manage_explain: "Um usu\u00e1rio, tendo os direitos de Gerenciamento de Equipes, pode realizar as seguintes a\u00e7\u00f5es:\n<ul>\n<li> criar equipes; </li>\n<li> desativar/ativar equipes; </li>\n<li> adicionar/remover pessoas a equipes; </li>\n<li> cancelar convites da equipe; </li>\n<li> adicionar/remover usu\u00e1rios da fun\u00e7\u00e3o de diretor da equipe; </li>\n<li> aprovar usu\u00e1rios convidados pelo diretor de uma equipe; </li>\n<li> editar e modificar as permiss\u00f5es e configura\u00e7\u00f5es da equipe. </li>\n</ul>\nSe voc\u00ea n\u00e3o tem os direitos de Gerenciamento de Equipes, voc\u00ea pode visualizar as informa\u00e7\u00f5es da equipe, mas n\u00e3o pode edit\u00e1-las.",
        user_manage_explain: "Um usu\u00e1rio, tendo os direitos de Gerenciamento de Usu\u00e1rios, pode realizar as seguintes a\u00e7\u00f5es:\n<ul>\n<li> editar as informa\u00e7\u00f5es e permiss\u00f5es dos usu\u00e1rios; </li>\n<li> desativar/ativar usu\u00e1rios; </li>\n<li> excluir usu\u00e1rios; </li>\n<li> redefinir a senha de usu\u00e1rios. </li>\n</ul>\nCaso voc\u00ea n\u00e3o tenha os direitos de Gerenciamento de Usu\u00e1rios, voc\u00ea pode visualizar as configura\u00e7\u00f5es de outros usu\u00e1rios, mas n\u00e3o pode edit\u00e1-las.",
        view_other_explain: "Um usu\u00e1rio, tendo a permiss\u00e3o de Visualizar como Outro Usu\u00e1rio, pode visualizar os perfis e arquivos de outros usu\u00e1rios na Conta Empresarial. Esse acesso \u00e9 somente de leitura.",
