        billing_manage_team_explain: "Usu\u00e1rios de uma equipe, tendo os direitos de Gerenciamento de Faturamento, podem realizar as seguintes a\u00e7\u00f5es:\n<ul> \n <li>modificar os dados de faturamento</li>\n</ul>\nEstes usu\u00e1rios n\u00e3o podem modificar o plano de assinatura e a cota da Conta Empresarial.",
