        team_manage_team_explain: "Un utilisateur poss\u00e9dant les droits de gestion d'\u00e9quipe peut :\n<ul>\n<li>cr\u00e9er des \u00e9quipes ;</li>\n<li>activer/d\u00e9sactiver des \u00e9quipes ;</li>\n<li>ajouter/supprimer des personnes \u00e0 l'\u00e9quipe ;</li>\n<li>annuler des invitations de l'\u00e9quipe ;</li>\n<li>d\u00e9finir/supprimer des utilisateurs comme chef d'\u00e9quipe ;</li>\n<li>approuver des utilisateurs invit\u00e9s par le chef d'une \u00e9quipe, et</li>\n<li>\u00e9diter et modifier les param\u00e8tres et autorisations d'une \u00e9quipe.</li>\n</ul>\nUn utilisateur ne poss\u00e9dant pas les autorisations de gestion d'\u00e9quipe peut afficher les informations des \u00e9quipes mais ne peut pas les modifier.",
