        team_manage_team_explain: "Ekipleri Y\u00f6net izinlerine sahip bir ekip i\u00e7indeki \u00fcyeler a\u015fa\u011f\u0131dakileri yapabilirler:\n<ul>\n <li> ekipler olu\u015fturabilirler; </li>\n <li> ekipleri etkisizle\u015ftirebilirler/etkinle\u015ftirebilirler; </li>\n <li> ekibe ki\u015filer ekleyebilirler/kald\u0131rabilirler;</li>\n<li> ekip davetiyelerini iptal edebilirler;</li>\n<li> ekip lideri olarak \u00fcyeler se\u00e7ebilirler/kald\u0131rabilirler;</li>\n <li> ekip lideri taraf\u0131ndan davet edilen \u00fcyeleri onaylayabilirler; </li>\n <li> ekiplerin \u00f6zelliklerini ve ayarlar\u0131n\u0131 d\u00fczenleyebilirler ve de\u011fi\u015ftirebilirler; </li>\n</ul>\nEkipleri Y\u00f6net iznine sahip olmayan \u00fcyeler ekipler hakk\u0131ndaki bilgileri g\u00f6rebilirler fakat onlar\u0131 d\u00fczenleyemezler. ",
        user_manage_team_explain: "\u00dcyeleri Y\u00f6net izinlerine sahip bir ekip i\u00e7indeki \u00fcyeler a\u015fa\u011f\u0131dakileri yapabilirler:\n<ul>\n <li> \u00fcyeler hakk\u0131ndaki bilgileri ve ayarlar\u0131 d\u00fczenleyebilirler; </li>\n <li> \u00fcyeleri etkisizle\u015ftirebilirler/etkinle\u015ftirebilirler;</li>\n <li> \u00fcyeleri silebilirler; </li>\n <li> \u00fcyelerin \u015fifrelerini s\u0131f\u0131rlayabilirler. </li>\n</ul>\n\u00dcyeleri Y\u00f6net izinlerine sahip olmayan \u00fcyeler di\u011fer \u00fcyelerin profillerini g\u00f6rebilirler fakat onlar\u0131 d\u00fczenleyemezler. ",
        account_manage_team_explain: "Hesab\u0131 Y\u00f6net izinlerine sahip bir ekip i\u00e7indeki \u00fcyeler a\u015fa\u011f\u0131dakileri yapabilirler:\n<ul>\n <li> \u015eirket bilgilerini ve hesap payla\u015f\u0131m ayarlar\u0131n\u0131 de\u011fi\u015ftirebilirler; </li>\n <li> Fatura bilgilerini de\u011fi\u015ftirebilirler; </li>\n<li> abonelik plan\u0131n\u0131 ve kotay\u0131 de\u011fi\u015ftirebilirler;</li>\n <li> \u015eirket Hesab\u0131na ki\u015filer davet edebilirler. </li>\n</ul>",
