        "rename playlist": "\u062a\u063a\u06cc\u06cc\u0631\u0646\u0627\u0645 \u0644\u06cc\u0633\u062a\u200c\u067e\u062e\u0634",
        'file is copied. <a href="#page=filemanager&folder=0">open folder</a>': '\u0641\u0627\u06cc\u0644 \u06a9\u067e\u06cc \u0634\u062f. <a href="#page=filemanager&folder=0">\u0628\u0627\u0632 \u06a9\u0631\u062f\u0646 \u067e\u0648\u0634\u0647</a>',
        "cannot rename the root folder.": "\u0639\u062f\u0645 \u062a\u0648\u0627\u0646\u0627\u06cc\u06cc \u062f\u0631 \u062a\u063a\u06cc\u06cc\u0631 \u067e\u0648\u0634\u0647 \u0631\u06cc\u0634\u0647.",
        "your account is full. you need to clear more space, before restoring files.": "\u062d\u0633\u0627\u0628 \u0634\u0645\u0627 \u067e\u0631 \u0645\u06cc\u200c\u0628\u0627\u0634\u062f. \u0628\u0627\u06cc\u062f \u0641\u0636\u0627\u06cc \u0628\u06cc\u0634\u062a\u0631\u06cc \u0628\u0631\u0627\u06cc \u0628\u0627\u0632\u06af\u0631\u062f\u0627\u0646\u062f\u0646 \u0641\u0627\u06cc\u0644\u200c\u0647\u0627 \u067e\u0627\u06a9\u200c\u0633\u0627\u0632\u06cc \u06a9\u0646\u06cc\u062f.",
        "folder renamed.": "\u067e\u0648\u0634\u0647 \u062a\u063a\u06cc\u06cc\u0631\u0646\u0627\u0645 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f.",
        "connection to facebook failed.": "\u0639\u062f\u0645 \u0645\u0648\u0641\u0642\u06cc\u062a \u062f\u0631 \u0627\u062a\u0635\u0627\u0644 \u0628\u0647 Facebook.",
