        "items to delete": "\u0645\u0648\u0627\u0631\u062f \u062d\u0630\u0641",
        "your email": "\u0627\u06cc\u0645\u06cc\u0644 \u0634\u0645\u0627",
        "please provide valid thumb size. width and height must be divisible either by 4 or 5 and must be between 16 and 2048 (1024 for height).": "\u0644\u0637\u0641\u0627 \u06cc\u06a9 \u062a\u0635\u0648\u06cc\u0631 \u06a9\u0648\u0686\u06a9 \u0628\u0627 \u062d\u062c\u0645 \u0645\u0639\u062a\u0628\u0631 \u0622\u0645\u0627\u062f\u0647 \u06a9\u0646\u06cc\u062f. \u0639\u0631\u0636 \u0648 \u0627\u0631\u062a\u0641\u0627\u0639 \u0628\u0627\u06cc\u062f \u0628\u062e\u0634 \u067e\u0630\u06cc\u0631 \u0628\u0631 \u06f4 \u06cc\u0627 \u06f5 \u0648 \u0628\u06cc\u0646 \u06f1\u06f6 \u0648 \u06f2\u06f0\u06f4\u06f8 (\u06f1\u06f0\u06f2\u06f4 \u0628\u0631\u0627\u06cc \u0627\u0631\u062a\u0641\u0627\u0639) \u0628\u0627\u0634\u062f.",
        height: "\u0627\u0631\u062a\u0641\u0627\u0639",
