        "file renamed.": "\u0646\u0627\u0645 \u0641\u0627\u06cc\u0644 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f.",
        "both new passwords should match.": "\u0647\u0631 \u062f\u0648 \u0627\u0633\u0645 \u0631\u0645\u0632 \u062c\u062f\u06cc\u062f \u0628\u0627\u06cc\u062f \u06cc\u06a9\u0633\u0627\u0646 \u0628\u0627\u0634\u0646\u062f.",
        "invite friends and get up to 20gb free space": "\u062f\u0648\u0633\u062a\u0627\u0646\u062a\u0627\u0646 \u0631\u0627 \u062f\u0639\u0648\u062a \u06a9\u0646\u06cc\u062f \u0648 \u062a\u0627 \u06f2\u06f0 \u06af\u06cc\u06af\u0627\u0628\u0627\u06cc\u062a \u0641\u0636\u0627\u06cc \u0631\u0627\u06cc\u06af\u0627\u0646 \u0628\u06af\u06cc\u0631\u06cc\u062f",
        "verify now": "\u062f\u0631\u0633\u062a\u06cc\u200c\u0633\u0646\u062c\u06cc \u06a9\u0646\u06cc\u062f",
        "ssl error occured. check sslerror for more information.": "\u062e\u0637\u0627\u06cc SSL \u0631\u062e \u062f\u0627\u062f. \u0628\u0631\u0627\u06cc \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0628\u06cc\u0634\u062a\u0631 sslerror \u0631\u0627 \u0628\u0631\u0631\u0633\u06cc \u06a9\u0646\u06cc\u062f.",
        "directory does not exist.": "\u0641\u0647\u0631\u0633\u062a \u0648\u062c\u0648\u062f \u0646\u062f\u0627\u0631\u062f.",
        "log in to save": "\u0628\u0631\u0627\u06cc \u0630\u062e\u06cc\u0631\u0647 \u0648\u0627\u0631\u062f \u0634\u0648\u06cc\u062f",
        "restart backup: ig": "\u0634\u0631\u0648\u0639 \u062f\u0648\u0628\u0627\u0631\u0647 \u067e\u0634\u062a\u06cc\u0628\u0627\u0646\u200f\u200c\u06af\u06cc\u0631\u06cc : ig",
        "very slow": "\u062e\u06cc\u0644\u06cc \u06a9\u0646\u062f",
