        "link is copied to clipboard": "\u067e\u06cc\u0648\u0646\u062f \u0628\u0647 \u0628\u064f\u0631\u06cc\u062f\u0647\u200f\u062f\u0627\u0646 \u06a9\u067e\u06cc \u0634\u062f",
        "max files:": "\u062d\u062f\u0627\u0643\u062b\u0631 \u0641\u0627\u06cc\u0644\u200c\u0647\u0627: ",
