        "maximum file size exceeded.": "\u0627\u0632 \u062d\u062f\u0645\u062c\u0627\u0632 \u062d\u062c\u0645 \u0641\u0627\u06cc\u0644 \u0628\u06cc\u0634\u062a\u0631 \u0634\u062f.",
