        "invite your friends to join pcloud": "\u0627\u0632 \u062f\u0648\u0633\u062a\u0627\u0646\u062a\u0627\u0646 \u0628\u0647 pCloud \u062f\u0639\u0648\u062a \u06a9\u0646\u06cc\u062f",
        "resend mail": "\u0627\u0631\u0633\u0627\u0644 \u0645\u062d\u062f\u062f \u0627\u06cc\u0645\u06cc\u0644",
