        "invalid lock type. please provide type (supported values: 0, 1, 2).": "\u0646\u0648\u0639 \u0642\u0641\u0644 \u0646\u0627\u0645\u0639\u062a\u0628\u0631 \u0627\u0633\u062a. \u0644\u0637\u0641\u0627 \u0646\u0648\u0639 \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f (\u0645\u0642\u0627\u062f\u06cc\u0631 \u0642\u0627\u0628\u0644 \u0642\u0628\u0648\u0644: 0, 1, 2).",
        "decline share": "\u0631\u062f \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9\u200c\u06af\u0630\u0627\u0631\u06cc",
        "user is over quota.": "\u06a9\u0627\u0631\u0628\u0631 \u0628\u06cc\u0634 \u0627\u0632 \u0633\u0647\u0645\u06cc\u0647 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u06a9\u0631\u062f\u0647 \u0627\u0633\u062a.",
        "internal error. try again later.": "\u062e\u0637\u0627\u06cc \u062f\u0627\u062e\u0644\u06cc. \u0644\u0637\u0641\u0627 \u0628\u0639\u062f\u0627 \u0633\u0639\u06cc \u06a9\u0646\u06cc\u062f.",
        "extracting '%name%' may take some time. you can close this window. the file extraction will continue in background.": "\u0639\u0645\u0644\u06cc\u0627\u062a \u0627\u0633\u062a\u062e\u0631\u0627\u062c '%name%' \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u06a9\u0645\u06cc \u0632\u0645\u0627\u0646 \u0628\u0628\u0631\u062f. \u0634\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0627\u06cc\u0646 \u067e\u0646\u062c\u0631\u0647 \u0631\u0627 \u0628\u0628\u0646\u062f\u06cc\u062f. \u0627\u0633\u062a\u062e\u0631\u0627\u062c \u0641\u0627\u06cc\u0644 \u062f\u0631 \u067e\u0633\u200f\u0632\u0645\u06cc\u0646\u0647 \u0627\u062f\u0627\u0645\u0647 \u067e\u06cc\u062f\u0627 \u0645\u06cc\u200c\u06a9\u0646\u062f.\n",
        "pcloud pro (300gb) for 1 year - $149.99": "pCloud Pro (\u0633\u06cc\u0635\u062f \u06af\u06cc\u06af\u0627\u0628\u0627\u06cc\u062a) \u06f7\u06f4\u06f9\u066c\u06f9\u06f5\u06f0 \u062a\u0648\u0645\u0627\u0646 \u0633\u0627\u0644\u0627\u0646\u0647",
        "invalid file/folder name.": "\u0646\u0627\u0645 \u0641\u0627\u06cc\u0644/\u067e\u0648\u0634\u0647 \u0646\u0627\u0645\u0639\u062a\u0628\u0631 \u0627\u0633\u062a.",
