        "valid and not expired facebook access token is required in field 'access_token'.": "\u0634\u0646\u0627\u0633\u06c0 \u062c\u0644\u0633\u06c0 \u062f\u0633\u062a\u0631\u0633\u06cc \u062f\u0631 \u062c\u0627\u06cc \u062f\u0631\u062c 'access_token' \u0628\u0647 Facebook \u0645\u0646\u0642\u0636\u06cc \u0634\u062f\u0647 \u06cc\u0627 \u0645\u0639\u062a\u0628\u0631 \u0646\u06cc\u0633\u062a.",
        "verifying in progress ...": "\u062f\u0631 \u062d\u0627\u0644 \u0627\u0646\u062c\u0627\u0645 \u062f\u0631\u0633\u062a\u06cc\u200c\u0633\u0646\u062c\u06cc .... ",
