        "you can only share your own files or folders. copy the file to a folder you own if you need to share it.": "\u0634\u0645\u0627 \u0641\u0642\u0637 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0641\u0627\u06cc\u0644\u200c\u0647\u0627 \u0648 \u067e\u0648\u0634\u0647\u200c\u0647\u0627\u06cc \u062e\u0648\u062f\u062a\u0627\u0646 \u0631\u0627 \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f. \u0628\u0631\u0627\u06cc \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9\u200c\u06af\u0630\u0627\u0631\u06cc\u060c \u0641\u0627\u06cc\u0644 \u0631\u0627 \u0628\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u067e\u0648\u0634\u0647\u200c\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0645\u0627\u0644\u06a9 \u0622\u0646 \u0647\u0633\u062a\u06cc\u062f \u06a9\u067e\u06cc \u06a9\u0646\u06cc\u062f.",
