        medium: "\u0645\u062a\u0648\u0633\u0637",
        "terms of service are expected to be accepted.": "\u0628\u0627\u06cc\u062f \u0634\u0631\u0627\u06cc\u0637 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u062e\u062f\u0645\u0627\u062a \u0631\u0627 \u0628\u067e\u0630\u06cc\u0631\u06cc\u062f.",
        "please provide valid bonus type in field 'bonus'.": "\u0644\u0637\u0641\u0627 \u062c\u0627\u06cc\u0632\u0647 \u0645\u0639\u062a\u0628\u0631 \u062f\u0631 \u062c\u0627\u06cc \u062f\u0631\u062c '\u062c\u0627\u06cc\u0632\u0647' \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.",
        "login / register": "\u0648\u0631\u0648\u062f / \u062b\u0628\u062a \u0646\u0627\u0645",
        "\u041f\u0430\u043f\u043a\u0430 renamed.": "\u0646\u0627\u0645 \u067e\u0648\u0634\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0631\u062f.",
        "please provide 'token'.": "\u0644\u0637\u0641\u0627 \u0634\u0646\u0627\u0633\u06c0 \u062c\u0644\u0633\u0647' \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.",
        "send this link to your friends to sign up and both get more free space": "\u0627\u06cc\u0646 \u067e\u06cc\u0648\u0646\u062f \u0631\u0627 \u0628\u0631\u0627\u06cc \u062f\u0648\u0633\u062a\u0627\u0646 \u062e\u0648\u062f \u062c\u0647\u062a \u062b\u0628\u062a \u0646\u0627\u0645 \u0627\u0631\u0633\u0627\u0644 \u06a9\u0646\u06cc\u062f \u0648 \u0647\u0631 \u062f\u0648 \u0641\u0636\u0627\u06cc \u0631\u0627\u06cc\u06af\u0627\u0646 \u0628\u06af\u06cc\u0631\u06cc\u062f.",
        "you currently have 15.0 gb space": "\u0634\u0645\u0627 \u062f\u0631 \u062d\u0627\u0644 \u062d\u0627\u0636\u0631 \u06f1\u06f5 \u06af\u06cc\u06af\u0627\u0628\u0627\u06cc\u062a \u0641\u0636\u0627 \u062f\u0627\u0631\u06cc\u062f",
        "you can copy the file to one of your folders. that's making you the owner of the file and therefore you can create a download link.": "\u0634\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0641\u0627\u06cc\u0644 \u0631\u0627 \u0628\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u067e\u0648\u0634\u0647\u200c\u0647\u0627\u06cc \u062e\u0648\u062f \u06a9\u067e\u06cc \u06a9\u0646\u06cc\u062f. \u0627\u06cc\u0646 \u06a9\u0627\u0631 \u0634\u0645\u0627 \u0631\u0627 \u0645\u0627\u0644\u06a9 \u0641\u0627\u06cc\u0644 \u0645\u06cc\u200c\u06a9\u0646\u062f \u0648 \u0633\u067e\u0633 \u0634\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u06cc\u06a9 \u067e\u06cc\u0648\u0646\u062f \u062f\u0627\u0646\u0644\u0648\u062f \u0627\u06cc\u062c\u0627\u062f \u06a9\u0646\u06cc\u062f.",
        "please provide flags.": "\u0644\u0637\u0641\u0627 \u067e\u0631\u0686\u0645\u200c\u0647\u0627 \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.",
        "items copied to your cloud.": "\u0645\u0648\u0627\u0631\u062f \u06a9\u067e\u06cc \u0634\u062f\u0647 \u0628\u0647 \u0627\u0628\u0631 \u0634\u0645\u0627.",
        "files to copy:": "\u0641\u0627\u06cc\u0644\u200c\u0647\u0627 \u0628\u0631\u0627\u06cc \u06a9\u067e\u06cc:",
        "learn how to manage your pcloud!": "\u0622\u0634\u0646\u0627\u06cc\u06cc \u0628\u0627 \u0645\u062f\u06cc\u0631\u06cc\u062a pCloud \u0634\u0645\u0627",
        "account:": "\u062d\u0633\u0627\u0628: ",
        "requested speed limit too low, see minspeed for minimum.": "\u0645\u062d\u062f\u0648\u062f\u06cc\u062a \u0633\u0631\u0639\u062a \u062f\u0631\u062e\u0648\u0627\u0633\u062a\u06cc \u0628\u0633\u06cc\u0627\u0631 \u06a9\u0645 \u0627\u0633\u062a\u060c \u0628\u0631\u0627\u06cc \u062d\u062f\u0627\u0642\u0644\u060c \u0633\u0631\u0639\u062a \u062d\u062f\u0627\u0642\u0644 \u0631\u0627 \u0645\u0634\u0627\u0647\u062f\u0647 \u06a9\u0646\u06cc\u062f.",
        "subject:": "\u0645\u0648\u0636\u0648\u0639: ",
