        "share a folder with other users": "\u067e\u0648\u0634\u0647\u200c\u0627\u06cc \u0631\u0627 \u0628\u0627 \u0633\u0627\u06cc\u0631 \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9\u200c\u06af\u0630\u0627\u0631\u06cc \u06a9\u0646\u06cc\u062f",
        "download selected": "\u062f\u0627\u0646\u0644\u0648\u062f \u0627\u0646\u062a\u062e\u0627\u0628 \u0634\u062f",
