        "awaiting user's activity": "\u0645\u0646\u062a\u0638\u0631 \u0641\u0639\u0627\u0644\u06cc\u062a \u06a9\u0627\u0631\u0628\u0631",
        "search albums": "\u062c\u0633\u062a\u200c\u0648\u062c\u0648\u06cc \u0622\u0644\u0628\u0648\u0645\u200c\u0647\u0627",
