        "pcloud pro (1tb) for 1 year - $499.99": "pCloud Pro (\u06f1 \u062a\u0631\u0627\u0628\u0627\u06cc\u062a) \u0628\u0631\u0627\u06cc \u06f2\u066c\u06f4\u06f9\u06f9\u066c\u06f9\u06f5\u06f0 \u062a\u0648\u0645\u0627\u0646 \u0633\u0627\u0644\u0627\u0646\u0647",
