        "block this user (ignore all share requests)": "\u0645\u0633\u062f\u0648\u062f\u0633\u0627\u0632\u06cc \u0627\u06cc\u0646 \u06a9\u0627\u0631\u0628\u0631 (\u0646\u0627\u062f\u06cc\u062f\u0647 \u06af\u0631\u0641\u062a\u0646 \u0647\u0645\u06c0 \u062f\u0631\u062e\u0648\u0627\u0633\u062a\u200c\u0647\u0627\u06cc \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9\u200c\u06af\u0630\u0627\u0631\u06cc)",
