        "verify your e-mail": "\u0627\u06cc\u0645\u06cc\u0644 \u062e\u0648\u062f \u0631\u0627 \u062f\u0631\u0633\u062a\u06cc\u200c\u0633\u0646\u062c\u06cc \u06a9\u0646\u06cc\u062f",
