        "<font><font>get more space</font></font>": "<font><font>\u0641\u0636\u0627\u06cc \u0628\u06cc\u0634\u062a\u0631 \u0628\u06af\u06cc\u0631\u06cc\u062f</font></font>",
        "expired 'token'.": "'\u0634\u0646\u0627\u0633\u06c0 \u062c\u0644\u0633\u0647' \u0645\u0646\u0642\u0636\u06cc \u0634\u062f\u0647 \u200c\u0627\u0633\u062a.",
        "share link to this folder so your friends can upload files to your account.": "\u067e\u06cc\u0648\u0646\u062f \u0627\u06cc\u0646 \u067e\u0648\u0634\u0647 \u0631\u0627 \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9 \u0628\u06af\u0630\u0627\u0631\u06cc\u062f \u062a\u0627 \u062f\u0648\u0633\u062a\u0627\u0646 \u0634\u0645\u0627 \u0628\u062a\u0648\u0627\u0646\u0646\u062f \u0641\u0627\u06cc\u0644\u200c\u0647\u0627 \u0631\u0627 \u0628\u0647 \u062d\u0633\u0627\u0628 \u0634\u0645\u0627 \u0622\u067e\u0644\u0648\u062f \u06a9\u0646\u0646\u062f.",
        "you can not create a download link from a shared folder because you are not the owner of the file.": "\u0634\u0645\u0627 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u067e\u06cc\u0648\u0646\u062f \u062f\u0627\u0646\u0644\u0648\u062f \u0631\u0627 \u0627\u0632 \u0627\u06cc\u0646 \u067e\u0648\u0634\u0647 \u0628\u0647\u200c\u200f\u0627\u0634\u062a\u0631\u0627\u06a9\u200f\u200c\u06af\u0630\u0627\u0634\u062a\u0647\u200c\u0634\u062f\u0647 \u0627\u06cc\u062c\u0627\u062f \u06a9\u0646\u06cc\u062f \u0632\u06cc\u0631\u0627 \u06a9\u0647 \u0634\u0645\u0627 \u0645\u0627\u0644\u06a9 \u0627\u06cc\u0646 \u0641\u0627\u06cc\u0644 \u0646\u06cc\u0633\u062a\u06cc\u062f.",
        "repeat playlist": "\u062a\u06a9\u0631\u0627\u0631 \u0644\u06cc\u0633\u062a\u200c\u067e\u062e\u0634",
