        "the security code is a group of 3 digits located on the back of the card, to the right of the signature strip.": "\u06a9\u062f \u0627\u0645\u0646\u06cc\u062a\u06cc \u0627\u0632 \u06f3 \u0631\u0642\u0645 \u062a\u0634\u06a9\u06cc\u0644 \u0645\u06cc\u200c\u0634\u0648\u062f \u06a9\u0647 \u067e\u0634\u062a \u06a9\u0627\u0631\u062a \u062f\u0631 \u0633\u0645\u062a \u0631\u0627\u0633\u062a \u0627\u0645\u0636\u0627\u0621 \u062f\u0631\u062c \u0634\u062f\u0647 \u200c\u0627\u0633\u062a.",
        "your card code is a 3 or 4 digit number that is found in these locations:": "\u06a9\u062f \u06a9\u0627\u0631\u062a \u0634\u0645\u0627 \u06f3 \u06cc\u0627 \u06f4 \u0631\u0642\u0645 \u0645\u06cc\u200c\u0628\u0627\u0634\u062f \u06a9\u0647 \u062f\u0631 \u0627\u06cc\u0646 \u0645\u06a9\u0627\u0646\u0647\u0627 \u0642\u0627\u0628\u0644 \u0645\u0634\u0627\u0647\u062f\u0647 \u0645\u06cc\u200c\u0628\u0627\u0634\u062f: ",
        "copying ...": "\u062f\u0631 \u062d\u0627\u0644 \u06a9\u067e\u06cc ...",
