        "please provide language.": "\u0644\u0637\u0641\u0627 \u0632\u0628\u0627\u0646 \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.",
        "register new account": "\u062b\u0628\u062a \u0646\u0627\u0645 \u062d\u0633\u0627\u0628 \u062c\u062f\u06cc\u062f",
