        "wrong user to accept the share.": "\u06a9\u0627\u0631\u0628\u0631 \u0627\u0634\u062a\u0628\u0627\u0647 \u0628\u0631\u0627\u06cc \u067e\u0630\u06cc\u0631\u0634 \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9\u200c\u06af\u0630\u0627\u0631\u06cc.",
