        'Please provide "sharerequestid" or "code" to accept a share.': '\u0644\u0637\u0641\u0627 "sharerequestid" \u06cc\u0627 "code" \u0631\u0627 \u0628\u0631\u0627\u06cc \u067e\u0630\u06cc\u0631\u0634 \u0628\u0647\u200c\u0627\u0634\u062a\u0631\u0627\u06a9\u200c\u06af\u0630\u0627\u0631\u06cc \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f.',
