        Yes: "\u0628\u0644\u0647",
        2012: "\u067e\u06cc\u0648\u0646\u062f \u062f\u0639\u0648\u062a\u200c\u0646\u0627\u0645\u0647 \u0645\u0646\u0642\u0636\u06cc \u06cc\u0627 \u0644\u063a\u0648 \u0634\u062f\u0647\u200c\u0627\u0633\u062a. \u0628\u0631\u0627\u06cc \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0628\u06cc\u0634\u062a\u0631 \u0628\u0627 \u0627\u0631\u0633\u0627\u0644\u200c\u06a9\u0646\u0646\u062f\u0647 \u0622\u0646 \u062a\u0645\u0627\u0633 \u0628\u06af\u06cc\u0631\u06cc\u062f.",
        "Billing address can't be empty": "\u0622\u062f\u0631\u0633 \u0635\u0648\u0631\u062a\u200c\u062d\u0633\u0627\u0628 \u0646\u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u062f \u062e\u0627\u0644\u06cc \u0628\u0627\u0634\u062f.",
        "Extracting '%name%' may take some time. You can close this window. The file extraction will continue in background.": "\u0639\u0645\u0644\u06cc\u0627\u062a \u0627\u0633\u062a\u062e\u0631\u0627\u062c '%name%' \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u06a9\u0645\u06cc \u0632\u0645\u0627\u0646 \u0628\u0628\u0631\u062f. \u0634\u0645\u0627 \u0645\u06cc\u200c\u062a\u0648\u0627\u0646\u06cc\u062f \u0627\u06cc\u0646 \u067e\u0646\u062c\u0631\u0647 \u0631\u0627 \u0628\u0628\u0646\u062f\u06cc\u062f. \u0627\u0633\u062a\u062e\u0631\u0627\u062c \u0641\u0627\u06cc\u0644 \u062f\u0631 \u067e\u0633\u200f\u0632\u0645\u06cc\u0646\u0647 \u0627\u062f\u0627\u0645\u0647 \u067e\u06cc\u062f\u0627 \u0645\u06cc\u200c\u06a9\u0646\u062f.\n",
